    public static class Extensions
    {
        public static double[] ToArray(this Stiffness st)
        {
            return new[]
            {
                st.RmyRe0, st.RmyRky, st.RmyRkz,
                st.RmzRe0, st.RmzRky, st.RmzRkz,
                st.RnxRe0, st.RnxRky, st.RnxRkz
            };
        }

        public static double HpPow(double a, int pow)
        {
            //return Math.Pow(a, pow);

            if (pow == 0)
                return 1;

            var buf = a;

            for (int i = 0; i < pow - 1; i++)
                buf *= a;

            return buf;
        }

        public static double GaussIntegrateOriginalTangentElasticModulus(this Material curve, double z0, double z1, double alpha, double beta, double fi, double e0,
           int r, int s, int ng)
        {
            var f = new Func<double, double>(z =>
            {
                return HpPow(alpha*z + beta, r)*HpPow(z, s)*curve.GetTangentElasticModulus(e0 + fi*z);
            });

            return GaussianIntegrate(f, z0, z1, ng);
        }

        public static double GaussIntegrateOriginalStress(this Material curve, double z0, double z1, double alpha, double beta, double fi, double e0,
          int r, int s, int ng)
        {
            var f = new Func<double, double>(z =>
            {
                return HpPow(alpha * z + beta, r) * HpPow(z, s) * curve.GetStress(e0 + fi * z);
            });

            return GaussianIntegrate(f, z0, z1, ng);
        }

