        public static bool IsNullOrEmpty(this Material mat)
        {
            if (ReferenceEquals(mat, null))
                return true;

            if (mat is Materials.NullMaterial)
                return true;

            return false;
        }


        public static int FindIndex<T>(this IEnumerable<T> arr, Func<int, T, bool> predicate)
        {
            var c = 0;

            foreach (var obj in arr)
            {
                if (predicate(c, obj))
                    return c;

                c++;
            }


            return -1;
        }

        public static Stiffness GetStiffnessNumerical(this Section section, StrainProfile strain)
        {
            var epsi1on = 1e-9;

            var sy = strain;
            sy.Ky += epsi1on;

            var sz = strain;
            sz.Kz += epsi1on;

            var se = strain;
            se.E0 += epsi1on;

            var f0 = section.GetSectionForces(strain);

            var fe = section.GetSectionForces(se);
            var fy = section.GetSectionForces(sy);
            var fz = section.GetSectionForces(sz);

            var buf = new Stiffness();

            buf.RmyRe0 = (fe.My - f0.My)/epsi1on;
            buf.RmyRky = (fy.My - f0.My)/epsi1on;
            buf.RmyRkz = (fz.My - f0.My)/epsi1on;

            buf.RmzRe0 = (fe.Mz - f0.Mz)/epsi1on;
            buf.RmzRky = (fy.Mz - f0.Mz)/epsi1on;
            buf.RmzRkz = (fz.Mz - f0.Mz)/epsi1on;

            buf.RnxRe0 = (fe.Nx - f0.Nx)/epsi1on;
            buf.RnxRky = (fy.Nx - f0.Nx)/epsi1on;
            buf.RnxRkz = (fz.Nx - f0.Nx)/epsi1on;

            return buf;
        }

        public static void Sort<T,U>(this List<T> lst, Func<T, U> orderBy)
            where U : IComparable<U>
        {
            var t = new Cmp<T, U>();
            t.OrderBy = orderBy;
            lst.Sort(t);
        }

        private class Cmp<T, U> : IComparer<T> where U : IComparable<U>
        {
            public Func<T, U> OrderBy;

            public int Compare(T x, T y)
            {
                return OrderBy(x).CompareTo(OrderBy(y));
            }
        }

